export default function ProgressBar() {
  return (
    <div className="progress-bar-container">
      <div className="colored-bar-contauner">
        <div className="progress-bar"></div>
        <div className="progress-bar-details">
          <p>Question </p>
          <p>10/280</p>
        </div>
      </div>
    </div>
  );
}
